import Vue from 'vue'
import App from './App.vue'
import "@/mobile/flexible" // 适配
import router from '@/router'

Vue.config.productionTip = false

import { Tabbar, TabbarItem, NavBar,Col, Row,Image as VanImage,Cell,Icon,Search, CellGroup,} from 'vant';
Vue.use(Tabbar);
Vue.use(TabbarItem);
Vue.use(NavBar);
Vue.use(Col);
Vue.use(Row);
Vue.use(VanImage);
Vue.use(Cell);
Vue.use(Icon);
Vue.use(Search);
Vue.use(CellGroup);


new Vue({
  render: h => h(App),
  router
}).$mount('#app')
